import React from 'react';
import axios from 'axios';

const KEY = 'AIzaSyBdXjGbMZ7Yd_W3digAhPLAjnKWACgL5Us';

class Search extends React.Component {
    constructor() {
        super()
        this.state = {
            search:'',
            tittle:''
        }
    }

    searchFeild = (event) => {
        this.setState({
            search: event.target.value
        })
    }

    // handleChange = (e) => {
    //     this.setState({ [e.target.name]: e.target.value });
    // }

    youtubeApi = async () => {
        console.log(this.state.search);
        const api = await axios.get(`https://www.googleapis.com/youtube/v3/search?part=snippet&q=${this.state.search}&key=${KEY} `)
            .then(res => {
                const data = res.data;
                console.log(data);
                this.setState({
                    tittle:data.regionCode
                })
            })
            .catch(err => console.log(err))
    }

    render() { 
        return (
            <div>
                <input type='text' placeholder='Search here' value={this.state.search} onChange={this.searchFeild} />
                {this.state.tittle}
                <button onClick={() => this.youtubeApi()} > Search </button>
            </div>
        )
    }

}

export default Search;
